style.css:
@-moz-document url("https://manifold.markets/") {
/*Trump*/
div[class*="absolute -bottom-4 -left-[18px]"] {
    background-size: 100% 100%;
}

/*Harris*/
div[class*="absolute -bottom-4 -right-[18px]"] {
    background-size: 100% 100%;
}

/*For some reason both images are labeled trump*/
img[alt*="trump"] {
    opacity: 0.00;
  }
}
